import Home from "../components/Home.vue";
import About from "../components/About.vue";
import { createRouter } from "vue-router";

const routes = [
  {
    path: "/",
    name: "Home",
    component: Home,
  },
  {
    path: "/about",
    name: "About",
    component: About,
  },
];

const router = createRouter({
  routes,
});

export default router;
